const getColors = () => {
  let boston_blue = '#2987AB';
  let bunker = '#2B3035';
  let dark_gray = '#A9A9A9';
  let oxford_blue = '#263238';
  let smoke = '#C0C0C0';
  let tiffany_blue = '#0A1C44';
  let vision_of_light = '#DDD0C8';

  return { 
    boston_blue, 
    bunker, 
    dark_gray,
    oxford_blue, 
    smoke,
    tiffany_blue, 
    vision_of_light 
  }
}

export { getColors };
